function StatusComponent({ stepProp, onNext, onPrev }) {
  return (
    <div className="statusContainer">
      <div className={stepProp >= 0 ? "statusActive" : ""}>
        Completare profil
      </div>
      <div className={stepProp >= 1 ? "statusActive" : ""}>
        Solicita colaborare
      </div>
      <div className={stepProp >= 2 ? "statusActive" : ""}>Raspuns cerere</div>
      <div className={stepProp >= 3 ? "statusActive" : ""}>Trimite cerere</div>
      <div className={stepProp >= 4 ? "statusActive" : ""}>Descarca cerere</div>
      <div className="butoane">
        <button onClick={onNext}>Next</button>
        <button onClick={onPrev}>Previous</button>
      </div>
    </div>
  );
}

export default StatusComponent;
